CREATE SCHEMA test;

create table test.test_project
(
    id           serial
        constraint test_project_pk
            primary key,
    project_name varchar,
    branch       varchar,
    version      integer,
    date         timestamp
);


UPDATE test.test_project SET project_name = INITCAP(TRIM(BOTH ' ' FROM project_name));
UPDATE test.test_project SET branch = INITCAP(TRIM(BOTH ' ' FROM branch));

CREATE TABLE test.newtable AS 
SELECT
    project_name,
    MIN(date) AS oldest_change_date,
    MAX(date) AS newest_change_date,
    MAX(version) AS max_version,
    COUNT(*) AS change_count
FROM
    test.test_project
GROUP BY
    project_name;